import { useState } from "react";
import toast from "react-hot-toast";
import axios from "../../utils/axios";
import PublicLayout from "../../components/layout/PublicLayout";

/* ---------- S3 ---------- */
const uploadToS3 = async (file, folder) => {
  const { data } = await axios.get(
    `/s3/presigned-url?fileType=${encodeURIComponent(
      file.type
    )}&folder=${folder}`
  );
  await fetch(data.uploadUrl, { method: "PUT", body: file });
  return data.fileUrl;
};

export default function RegisterProfile() {
  const [loading, setLoading] = useState(false);

  const [account, setAccount] = useState({
    username: "",
    password: "",
    email: "",
  });

  const [form, setForm] = useState({
    stageName: "",
    age: "",
    tagline: "",
    city: "",
    nationality: "",
    profileType: "",
    services: [],
    placeOfService: [],
    heightCm: "",
    weightKg: "",
    cupSize: "",
    ethnicity: "",
    bodyType: "",
    hairColor: "",
    eyeColor: "",
    breast: "",
    pubicHair: "",
    meetingWith: [],
    languages: "",
    locationText: "",
    rates: {},
    availableDays: [],
    availabilityText: "",
    website: "",
    snapchat: "",
    preferredContact: "",
    aboutMe: "",
  });

  const [profilePhotos, setProfilePhotos] = useState([]);
  const [galleryPhotos, setGalleryPhotos] = useState([]);

  const onAccountChange = (e) =>
    setAccount({ ...account, [e.target.name]: e.target.value });

  const onChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === "checkbox") {
      setForm((p) => {
        const arr = p[name] || [];
        return {
          ...p,
          [name]: checked ? [...arr, value] : arr.filter((v) => v !== value),
        };
      });
    } else {
      setForm({ ...form, [name]: value });
    }
  };

  const submit = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);

      const userRes = await axios.post("/auth/register", account);
      const userId = userRes.data.user.id;

      const profileImage = profilePhotos[0]
        ? { url: await uploadToS3(profilePhotos[0], "models/profile") }
        : null;

      const portfolio = [];
      for (const img of galleryPhotos) {
        portfolio.push({ url: await uploadToS3(img, "models/portfolio") });
      }

      await axios.post("/models/register", {
        ...form,
        languages: form.languages.split(",").map((l) => l.trim()),
        profileImage,
        portfolio,
        userId,
      });

      toast.success("Profile submitted for review");
    } catch (e) {
      toast.error(e.response?.data?.message || "Registration failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <PublicLayout>
      <main className="single-profile">
        <section className="sp-title-bar">
          <div className="sp-inner">
            <h1 className="sp-main-title">Model Registration</h1>
            <p className="sp-subline">
              Submit your details to create a verified profile
            </p>
          </div>
        </section>

        <section className="sp-details">
          <div className="sp-inner">
            <form className="reg-form" onSubmit={submit}>
              {/* ACCOUNT */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Account details</h2>
                <input
                  name="username"
                  placeholder="Username"
                  required
                  onChange={onAccountChange}
                />
                <input
                  type="password"
                  name="password"
                  placeholder="Password"
                  required
                  onChange={onAccountChange}
                />
                <input
                  type="email"
                  name="email"
                  placeholder="Email"
                  required
                  onChange={onAccountChange}
                />
              </div>

              {/* PROFILE HEADER */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Profile header</h2>
                <input
                  name="stageName"
                  placeholder="Display name"
                  required
                  onChange={onChange}
                />
                <input
                  type="number"
                  min="18"
                  name="age"
                  placeholder="Age"
                  required
                  onChange={onChange}
                />
                <input
                  name="tagline"
                  placeholder="Tagline"
                  onChange={onChange}
                />
                <input name="city" placeholder="Area" onChange={onChange} />
                <input
                  name="nationality"
                  placeholder="Nationality"
                  onChange={onChange}
                />
              </div>

              {/* PLACE OF SERVICE */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Place of service</h2>
                <label>
                  <input
                    type="checkbox"
                    name="placeOfService"
                    value="incall"
                    onChange={onChange}
                  />{" "}
                  Incall
                </label>
                <label>
                  <input
                    type="checkbox"
                    name="placeOfService"
                    value="outcall"
                    onChange={onChange}
                  />{" "}
                  Outcall
                </label>
              </div>

              {/* INFO CARD */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Info card details</h2>
                <input
                  name="heightCm"
                  placeholder="Height"
                  onChange={onChange}
                />
                <input
                  name="weightKg"
                  placeholder="Weight"
                  onChange={onChange}
                />
                <input
                  name="cupSize"
                  placeholder="Cup size"
                  onChange={onChange}
                />
              </div>

              {/* MY PROFILE DETAILS */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">My profile details</h2>
                <input
                  name="ethnicity"
                  placeholder="Ethnicity"
                  onChange={onChange}
                />
                <input
                  name="bodyType"
                  placeholder="Body type"
                  onChange={onChange}
                />
                <input
                  name="hairColor"
                  placeholder="Hair color"
                  onChange={onChange}
                />
                <input name="eyeColor" placeholder="Eyes" onChange={onChange} />
                <input name="breast" placeholder="Breast" onChange={onChange} />
                <input
                  name="pubicHair"
                  placeholder="Pubic hair"
                  onChange={onChange}
                />
                <input
                  name="languages"
                  placeholder="Languages"
                  onChange={onChange}
                />
                <input
                  name="locationText"
                  placeholder="Location text"
                  onChange={onChange}
                />
              </div>

              {/* RATES */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Rates</h2>
                <input
                  placeholder="30 min incall"
                  onChange={(e) =>
                    setForm({
                      ...form,
                      rates: { ...form.rates, min30In: e.target.value },
                    })
                  }
                />
                <input
                  placeholder="30 min outcall"
                  onChange={(e) =>
                    setForm({
                      ...form,
                      rates: { ...form.rates, min30Out: e.target.value },
                    })
                  }
                />
                <input
                  placeholder="1h incall"
                  onChange={(e) =>
                    setForm({
                      ...form,
                      rates: { ...form.rates, hour1In: e.target.value },
                    })
                  }
                />
                <input
                  placeholder="1h outcall"
                  onChange={(e) =>
                    setForm({
                      ...form,
                      rates: { ...form.rates, hour1Out: e.target.value },
                    })
                  }
                />
                <input
                  placeholder="Rate note"
                  onChange={(e) =>
                    setForm({
                      ...form,
                      rates: { ...form.rates, note: e.target.value },
                    })
                  }
                />
              </div>

              {/* AVAILABILITY */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Availability</h2>
                {["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"].map((d) => (
                  <label key={d}>
                    <input
                      type="checkbox"
                      name="availableDays"
                      value={d}
                      onChange={onChange}
                    />{" "}
                    {d}
                  </label>
                ))}
                <input
                  name="availabilityText"
                  placeholder="Typical hours"
                  onChange={onChange}
                />
              </div>

              {/* CONTACT */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Contact details</h2>
                <input
                  name="phone"
                  placeholder="Phone / WhatsApp"
                  onChange={onChange}
                />
                <input
                  name="website"
                  placeholder="Website"
                  onChange={onChange}
                />
                <input
                  name="snapchat"
                  placeholder="Snapchat / X"
                  onChange={onChange}
                />
              </div>

              {/* ABOUT */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">About me</h2>
                <textarea name="aboutMe" rows="6" onChange={onChange} />
              </div>

              {/* MEDIA */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Photos & gallery</h2>
                <input
                  type="file"
                  accept="image/*"
                  multiple
                  onChange={(e) => setProfilePhotos(e.target.files)}
                />
                <input
                  type="file"
                  accept="image/*"
                  multiple
                  onChange={(e) => setGalleryPhotos(e.target.files)}
                />
              </div>

              <button className="reg-submit-btn" disabled={loading}>
                {loading ? "Submitting..." : "Submit profile"}
              </button>
            </form>
          </div>
        </section>
      </main>
    </PublicLayout>
  );
}
